import logo from './logo.svg';
import './App.css';
import {Link} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Link to="/contact">Click to go to contact</Link>
        <Link to="/about">Click to go to about</Link>
        <Link to="/meme1">Click to go to the first meme page</Link>
        <Link to="/meme2">Click to go to the second meme page</Link>
      </header>
    </div>
  );
}

export default App;
